import React, {ChangeEvent} from 'react';


type MaxMInValueType = {
    maxValue: (e: number) => void
    minValue: (e: number) => void

}


export const MaxMInValue = (props: MaxMInValueType) => {


    const MaxValue = (e: ChangeEvent<HTMLInputElement>) => {
        props.maxValue(+e.currentTarget.value)
    }
    const MinValue = (e: ChangeEvent<HTMLInputElement>) => {
        props.minValue(+e.currentTarget.value)
    }


    return (
        <div>
            <div>Max Value: <input onChange={MaxValue} type='number'/></div>
            <div>Min Value: <input  onChange={MinValue} type='number'/></div>
            <button>set</button>
        </div>
    );
};
